window.bookSummaryJSON = "<p>Thrown for the biggest loop she would likely ever be forced to experience, Daisy found herself at a complete loss for once.&nbsp;While a course of action normally made itself clear to her, her new predicament made following her instincts impossibly dangerous. One misstep, and she not only might harm those she cared for, but could even fracture the universe itself.</p> <p>Forced to rely on her unlikely alliances along with her own wits, Daisy would soon find herself going head-to-head with the most brutal race of alien conquerors the galaxy had ever known.&nbsp;</p> <p>If she succeeded, freedom was the prize. If she failed, oppression, slavery, and death awaited the vanquished.</p> <p>The stakes were high and the pressure higher, but with the help of friends, both old and new, she was determined to give it her all. But if she failed, all was exactly what she might lose.</p>"; 
